import logo from './logo.png';
import './App.css';

function App() {
  return (
    <div className="App">
      <header className="App-header">
        <img src={logo} className="App-logo" alt="logo" />
        <p> Fly At Will </p>
        <form>
          <label>Departure <input type="text" name="depart" /></label>
          <label>Arrival <input type="text" name="arr" /></label>
          <label>Date Outward<input type="text" name="name" /></label>
          <label>Date Inward<input type="text" name="name" /></label>
          <label>Trip Type <input type="text" name="name" /></label>
          <input type="submit" value="Submit" />
        </form>
        <select>
  <option value="grapefruit">葡萄柚</option>
  <option value="lime">酸橙</option>
  <option selected value="coconut">椰子</option>
  <option value="mango">芒果</option>
</select>
      </header>
    </div>
  );
}


export default App;

